import React, { useState, useEffect } from 'react'
import './App.css';

function App() {
  const renderNUM = 0;
  const [stickerArray, setStickerArray] = useState([]);
  const stickerNUM = 10;


  useEffect(() => {
    let newStickerArray = [...stickerArray];
    for (let i = 0; i < stickerNUM; i++) {
      newStickerArray.push(React.Children.toArray(<div key={i}>{i}</div>));
    };
    setStickerArray(newStickerArray);
  }, [renderNUM])


  return (
    <React.Fragment>
      <div>{stickerArray}</div>
    </React.Fragment>
  );
}

export default App;
